from .base import Basefrom django.db import models#Tipo de retencioonclass Tretenciones(Base):    desc_tire=models.CharField    ('Descripcion',    max_length=75, null=True, blank=True, default='')    mont_tire=models.FloatField   ('Monto',   null=True, blank=True, default=0)    porc_tire=models.IntegerField ('Porcentaje',   null=True, blank=True, default=0)    reso_tire=models.CharField    ('Se aplica sobre',    max_length=1, null=True, blank=True, default='')    labo_tire=models.CharField    ('Indica si es laboral',    max_length=1, null=True, blank=True, default='')    class Meta:        ordering = ['desc_tire']        indexes  = [models.Index(fields=['id',])]         db_table = u'"comun\".\"tretenciones"'